import React from 'react';
import Header from './componentes/Header'
import Formulario from './componentes/Formulario'
//Redux Hooks

function App() {
  return (
    <div className="App">
      <Header
        titulo="Clima App"
      />

      <div className="contenedor-form">
        <div className="container">
          <div className="row">
            <div className="col s12 m6">
              <Formulario/>
            </div>
          </div>
        </div>
      </div>

    </div>
  );
}

export default App;
